import Window from "../components/window/Window";
import { UserDataType } from "../types/Interfaces";
import { useState, useContext } from "react";
import { Form } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Global from "../context/Global";

const LogInPage = () => {
    const {setLocalStore, localStore} = useContext(Global)
  
    const [loginData, setLoginData] = useState<Omit<UserDataType, "userAvatar">>({
    userLogin: "",
    userEmail: "",
    userPassword: "",
  });

  const sendUserDataInLS = () => {
    console.log(loginData);
    if (!!loginData.userEmail && !!loginData.userLogin && !!loginData.userPassword) {
        setLocalStore({...localStore, User: loginData})
    }
  }

  return (
    <Window>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Login</Form.Label>
        <Form.Control type="text" placeholder="Login" onChange={event => setLoginData({...loginData, userLogin: event.target.value})}/>
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Email address</Form.Label>
        <Form.Control type="email" placeholder="Enter email" onChange={event => setLoginData({...loginData, userEmail: event.target.value})}/>
        <Form.Text className="text-muted">
          We'll never share your email with anyone else.
        </Form.Text>
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>Password</Form.Label>
        <Form.Control type="password" placeholder="Password" onChange={event => setLoginData({...loginData, userPassword: event.target.value})}/>
      </Form.Group>

      <Button variant="primary" type="submit" className="col-12" onClick={sendUserDataInLS}>
        Log in
      </Button>
    </Window>
  );
};

export default LogInPage;
